import React from 'react'
import styles from './Cart.module.css'

export default function Cart() {
  return (
    <div className={`${styles.Container_Cart} rounded border border-secondary`}>
        <div className={styles.Image_Item}>
            <img className='w-100' src="https://img.lazcdn.com/g/p/cd92da7e165d756dcb3d7da99d079675.jpg_720x720q80.jpg" alt="" />
        </div>

        <div className='Content_Item'>Vsmart Live4 </div>
        <div className='Price_Item'>2.599.000đ</div>
    </div>
  )
}
